import classes from "./Description.module.css";

function Description(props) {
  return (
    <div className={classes.description}>
      <h3>Hi!</h3>
      <p>
        I am Farhan Uz Zaman. An aspiring researcher who is passionate about
        learning new things, work in competitive situations and reaching new
        heights.
      </p>
    </div>
  );
}
export default Description;
